⁠Join Team Pelagic Australia as we reminisce on season's past with some incredible black marlin fishing aboard Pelagic Pro Team Captain, Luke Fallon's, custom 56' O'Brien KEKOA.  Experience the amazing marlin fishery of Australia's famed Great Barrier Reef, and watch master wireman, Jarad "Dingo" Boshammer, put on a clinic in taming some of the largest billfish on the planet. This video features highlights from the 2011 season as captured by @kelldallfall.⁠⁠
