In the theme of St. Paddy’s Day, Pelagic once again brought the fun to South Florida with our 3rd Annual Shamrock Shootout that featured concerts, parties, a fishing tournament extravaganza., and of course - cocktails & green beer. ☘️🍻🎣⁠⠀
⁠⠀
Held annually at Sailfish Marina [Singer Island – Palm Beach, FL] on St. Paddy’s Day Weekend, this unique tournament is packed full of excitement, and laced with Irish flare. Congrats to Team OFF THE WALL on taking home the tournament victory, a cash earnings of $13,570, a custom Shamrock Shootout-edition Fender electric guitar, and the coveted title of Tournament Grand Champion.⁠⠀
⁠⠀
